DROP TABLE IF EXISTS `productos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `productos` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `nombre` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `descripcion` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `url_tiktok` text COLLATE utf8mb4_unicode_ci,
  `descripcion_social` varchar(125) COLLATE utf8mb4_unicode_ci NOT NULL,
  `genero` int(11) NOT NULL,
  `marca_id` int(11) DEFAULT NULL,
  `modelo` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `nuevo` tinyint(1) DEFAULT NULL,
  `catalogo` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `destacado` tinyint(1) DEFAULT NULL,
  `slider` tinyint(1) DEFAULT NULL,
  `publicado` tinyint(1) DEFAULT NULL,
  `envio` int(1) NOT NULL DEFAULT '0',
  `oferta` tinyint(1) DEFAULT NULL,
  `fecha_inicio` date DEFAULT NULL,
  `fecha_fin` date DEFAULT NULL,
  `moneda` int(11) NOT NULL,
  `costo` double(8,2) NOT NULL,
  `precio_anterior` double(8,2) DEFAULT NULL,
  `precio_venta` double(8,2) NOT NULL,
  `precio_mayorista` double(8,2) DEFAULT NULL,
  `descuento` int(11) DEFAULT NULL,
  `precio_sugerido` double(8,2) DEFAULT NULL,
  `codigo` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `stock` int(11) NOT NULL,
  `disponibilidad` int(11) NOT NULL,
  `img` varchar(1000) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `video` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `slug` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `productos_slug_unique` (`slug`),
  KEY `fk_productos_marcas` (`marca_id`),
  CONSTRAINT `fk_productos_marcas` FOREIGN KEY (`marca_id`) REFERENCES `marcas` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1008 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

