s\', sans-serif; font-size: 13px; background-color: #ffffff;\">Nautica Blue de Nautica es una fragancia de la familia olfativa Arom&aacute;tica Acu&aacute;tica para Hombres. Nautica Blue se lanz&oacute; en 2005. La Nariz detr&aacute;s de esta fragrancia es Maurice Roucel. Las Notas de Salida son pi&ntilde;a, durazno (melocot&oacute;n) y bergamota; las Notas de Coraz&oacute;n son jazm&iacute;n y nen&uacute;far (lirio de agua); las Notas de Fondo son s&aacute;ndalo, almizcle y cedro.</span></p>',NULL,'Aroma: Olfativa Aromática Acuática\r\nPara: Hombre\r\nFecha de Lanzami',2,29,'Blue',0,'2',0,NULL,0,1,0,NULL,NULL,1,9000.00,NULL,14400.00,NULL,NULL,NULL,NULL,0,3,'Nautica-blue-100ml.jpg',NULL,'nautica-Blue'),(82,'2019-12-29 22:10:40','2020-12-17 15:59:20','Issey Miyake Tradicional 125ml','<p><span style=\"color: #666666; font-family: \'Open Sans\', sans-serif; font-size: 13px; background-color: #ffffff;\">L\'Eau d\'Issey Pour Homme de Issey Miyake es una fragancia de la familia olfativa Amaderada Acu&aacute;tica para Hombres. L\'Eau d\'Issey Pour Homme se lanz&oacute; en 1994. La Nariz detr&aacute;s de esta fragrancia es Jacques Cavallier. Las Notas de Salida son cilantro, cipr&eacute;s, mandarina, estrag&oacute;n, yuzu, cedr&oacute;n (hierba luisa, verbena de olor), salvia, bergamota, lim&oacute;n (lima &aacute;cida) y calone; las Notas de Coraz&oacute;n son nuez moscada, reseda (mi&ntilde;oneta), canela de Ceylan, geranio bourbon, azafr&aacute;n, lirio de los valles (muguete) y flor de loto azul; las Notas de Fondo son vetiver de Tahit&iacute;, almizcle, s&aacute;ndalo, cedro, &aacute;mbar y tabaco.</span></p>',NULL,'Aroma: Amaderada Acuática\r\nFecha de Lanzamiento: 1994',2,38,'Tradicional',0,'2',0,NULL,0,1,0,NULL,NULL,1,23000.00,NULL,39900.00,NULL,NULL,NULL,NULL,0,3,'Issey-Miyake-tradicional-125ml.jpg',NULL,'issey-miyake-Tradicional'),(83,'2019-12-29 22:17:39','2020-03-24 17:19:47','Dolce Gabbana Light Blue Set','<p><span style=\"color: #666666; font-family: \'Open Sa